import './App.css';
import MicrosoftForm from './MicrosoftForm';
import Info from './MicrosoftForm';
import GoogleForm from './GoogleForm'

function App() {
  return (
    <div className="App">
      <Info /> 
      <GoogleForm /> 
      <MicrosoftForm /> 
      <AddItem /> 
      <IfElse />
        <p>
          My app is running woot woot! Waka Waka
        </p>
    </div>
  );
}

function AddItem() {
  return (
    <form>
      <label for="text-form">Type Something: </label>
      <input type="text" id="text-form" />
    </form>
  );
}

function IfElse(){
  var showValue = false; 
  // var munyanyo = "doisef"; 

  if (showValue) {
    return (
      <form>
        <label for="text-form2">Type your mother's first name: </label>
        <input type="text" id="text-form2" />
      </form>
    );
  }
  else {
    return (
      <form>
        <label for="text-form3">Type your father's last name: </label>
        <input type="text" id="text-form3" />
      </form>
    );
  }
}

export default App;
